Legion of Super-Heroes v7 #19
Publisher:  DC Comics
Publication Date:  April 17, 2013

Writers:  Paul Levitz and Keith Giffen
Artists:  Scott Kolins (pgs 1-10) and Jeff Johnson (pgs 11-20)
Colorist:  Javier Mena, Matt Yackey, and Pete Pantazis
Letterer:  Taylor Esposito
Cover:  J.J. Kirby

The Legion of Super-Heroes is lost and hurtling into the sun as Mon-El battles the Emerald Empress. Can the strongest Legionnaire stand against one of their strongest villains?

Thanks goes to Shining Knight for this release.

